#=
struct OptModel
    objective::Sym
    constraints::Array{Sym}
    init::Array{Float64}
    p::Parameter
end

function numParameters(m::OptModel)
    sum(m.p.n)
end

function lower_bounds(m::OptModel)
    vcat([0.0 for i in 1:m.p.n[1]],[0.0 for i in 1:m.p.n[2]])
end

function upper_bounds(m::OptModel)
    vcat([1.0 for i in 1:m.p.n[1]],[Inf for i in 1:m.p.n[2]])
end

function get_phi(m::OptModel)
    get_phi(m.p)
end
